  false,\n\t\"url\": null,\n\t\"notes\": \"This survey supports a regional effort
  to understand the distribution, abundance, and success of this species. The presence
  or absence of this species would be an indicator of condition in some of our permanent
  wetlands. This is a refuge survey effort to indicate Trumpeter swan breeding population
  trends and help evaluate the effects of habitat management practices (ex. water
  manipulations) in meeting refuge objectives. Any error or variance in estimates
  by following this procedure is assumed to be consistent and thus yield reliable
  trend data. This survey can be used in adaptive management to assess swan response
  to a specific management action at a field or plant community level if mapping procedures
  are followed and data is entered into GIS.\",\n\t\"license_title\": \"License Not
